  PRIMARY KEY (`resu_id`),
  KEY `fingerprint` (`resu_fingerprint`(255)),
  KEY `sessionFingerprint` (`resu_sessionFingerprint`(255)),
  KEY `recoveryTime` (`resu_recoveryTime`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8;

